var MAX_ENTRIES = 10;			//!!! Page it


// This is the 'constructor' for a javascript object.

function hitCounter(id, freq, qlist) {
    this.idx = id;	// the index of the hit in the file list 
    this.cnt = freq;	// keep track of the value of this hit
    this.wgroup = 0;	// word group, for sorting results
    this.q = qlist;	// keep track of the query word index (into query list)
}	// hitCounter()

function append_q(hlist, hidx, hfrq, qidx) {
    if (hidx.length == undefined) { hidx = [hidx]; }	// make into array
    if (hfrq.length == undefined) { hfrq = [hfrq]; }

    for (var j = 0; j < hidx.length; j++) {
	for (var i = 0; i < hlist.length; i++) {
	    if (hlist[i].idx == hidx[j]) {	// file id
		var cnt_tmp = hlist[i].cnt;
		var q_tmp = hlist[i].q;

		if (cnt_tmp.length == undefined) {cnt_tmp = [cnt_tmp];}
		if (q_tmp.length == undefined) {q_tmp = [q_tmp];}

		    // If query word already has an entry, just accumulate cnt.

		for (var k = 0; k < q_tmp.length; k++) {
		    if (q_tmp[k] == qidx) {	// do not create new entry
			cnt_tmp[k] = cnt_tmp[k] + hfrq[j];
			break;		// there should be max 1 such
		    }
		}
		if (k >= q_tmp.length) {	// did not find it
		    cnt_tmp.push(hfrq[j]);
		    q_tmp.push(qidx);	// concat only works on 2 arrays
		} 

		hlist[i].cnt = cnt_tmp;
		hlist[i].q = q_tmp;

		break; 		// file only appears once in score list
	    }
	}
	if (i >= hlist.length) {	// file not found
	    hlist.push(new hitCounter(hidx[j], hfrq[j], qidx));
	}
    }
}

// Accumulate total query hit freq per file.
// hlist: score_list (that we are building)
// hidx: file index number
// hfrq: file score for a given word

function tallyIndexHit(hlist, hidx, hfrq, query) {
    for (var j=0; j < hidx.length; j++) { // step through score table entries
	var inlist = false;

	for (var k=0; k < hlist.length; k++) {	// step through score table
	    if (hlist[k].idx == hidx[j]) {	// accumulate for this file
		hlist[k].cnt += hfrq[j];
		hlist[k].q += query;		// reset
		inlist = true;
	    }
	}

	if (!inlist) {		// if file not in score table, create new entry
	    hlist.push(new hitCounter(hidx[j], hfrq[j], query));  // initialize
	}
    }
}	// tallyIndexHit()


// Arrange and count the references for each match.
// index_list: for each matched word, the index into the hash table
// table: hash table
// scale: scale factor to weigh word boundary matches higher
// score_list: list of file scores that will be built, pairs
//	of [file_index, file_score]

function tallyIndexList(table, score_list, index_list, scale, query) {

	// Step through the selected entries of the hash table.

    for (var i=0; i < index_list.length; i++) {
	var idxs = [], frqs = [];

	if (! table[index_list[i]][1].length) {	// turn into array objects
	    idxs = [ table[index_list[i]][1] ];
	    frqs = [ table[index_list[i]][2] ];
	    for (var j=0; j < frqs.length; j++) {	// !!!
		frqs[j] = frqs[j] * scale[i];
	    }
	} else {
	    idxs = table[index_list[i]][1];
	    for (var j=0; j < table[index_list[i]][2].length; j++) {
		frqs[j] = table[index_list[i]][2][j] * scale[i];
	    }
	}
	tallyIndexHit(score_list, idxs, frqs, query);
    }
}	// tallyIndexList()

function calculateScore(query, table, score, m_idx, multfactor) {

	// Rebuild the query pattern; put OR bar between words and
	// make case-insensitive.
	// Make second query pattern: exact word boundaries.
	// Score exact word boundaries much higher.

    var pat = new RegExp(query.join("\|"), "i");
    var pat_start = new RegExp("\\b"+query.join("\|\\b"), "i");
    var pat_word = new RegExp("\\b"+query.join("\\b\|\\b")+"\\b", "i");

    var scale = new Array();
    var i;

	// Find the match indexes from the inverted reference table.
	// Score the exact word boundary match higher.

    for (i=0; i < table.length; i++) {
	if (pat_word.test(table[i][0])) {
	    m_idx.push(i); scale.push(5 * multfactor);
	} else if (pat_start.test(table[i][0])) {
	    m_idx.push(i); scale.push(2 * multfactor);
	} else if (pat.test(table[i][0])) {
	    m_idx.push(i); scale.push(1 * multfactor);
	}
    }

    if (query.length == 1) {
	tallyIndexList(table, score, m_idx, scale, 0);
    } else {

	// Augment scores for pages matching more than one query word. Separate
	// the existing match list according to each query word and find the
	// references in the intersection.
	// Step through the individual words of query in succession.

	var x_idx = new Array();
	var x_frq = new Array();
	
	var file_qw = new Array();	// file query words

	for (i=0; i < query.length; i++) {
	    var idx = new Array();
	    var frq = new Array();
	    var q_i = new Array();
	    var fq  = new Array();

	    var qq = query[i];

	    pat       = new RegExp(qq, "i");
	    pat_start = new RegExp("\\b"+qq, "i");
	    pat_word  = new RegExp("\\b"+qq+"\\b", "i");


	        // Step through the hits on *any* of the query words.
		// Keep track, for each hit, which words were matched.

	    for (j=0; j < m_idx.length; j++) {
		var ent = table[m_idx[j]];
		var word = ent[0];
		var m_i  = ent[1];	// file indices
		var m_f  = ent[2];	// freq in each file
		fq = m_f;

		if (pat_word.test(word)) {
		    idx=idx.concat(m_i); // fq=fq.concat(m_f);
		    if (fq.length == undefined) { fq = [fq]; }
		    for (k=0; k<fq.length; k++) { fq[k]=fq[k]*5*multfactor; }
		    append_q(score, m_i, fq, i);
		} else if (pat_start.test(word)) {
		    idx=idx.concat(m_i); // fq=fq.concat(m_f);
		    if (fq.length == undefined) { fq = [fq]; }
		    for (k=0; k<fq.length; k++) { fq[k]=fq[k]*2*multfactor; }
		    append_q(score, m_i, fq, i);
		} else if (pat.test(word)) {
		    idx=idx.concat(m_i); // fq=fq.concat(m_f);
		    if (fq.length == undefined) { fq = [fq]; }
		    for (k=0; k<fq.length; k++) { fq[k]=fq[k]*1*multfactor; }
		    append_q(score, m_i, fq, i);
		}
	    }
		// For each query word, store file indices, freqs, and
		//	query word index.
	}
    }

	// Sort the list according to 1) order of query words and 2) the score.
	// First go through the list and collect counts for the same words.

    for (i=0; i < score.length; i++) {
	var q_arr = score[i].q;
    }

    var qlen = query.length;

    for (i=0; i < score.length; i++) {
	var q_arr = score[i].q;

	if (q_arr.length == undefined) {	// only 1 word
	    score[i].wgroup = (qlen - score[i].q) * qlen * 1000;
	    score[i].cnt = score[i].cnt + score[i].wgroup;
	    score[i].q = [query[score[i].q]];
	} else {
	    var wg = 1;
	    var sc = 0;
	    var cnt_arr = score[i].cnt;

		// !!! Add large value to wg to make it the primary sort key.

	    for (j=0; j < q_arr.length; j++) {	// multiple files
		wg = wg * (qlen - q_arr[j]) * qlen * 1000;
		sc = sc + cnt_arr[j];
		(score[i].q)[j] = query[(score[i].q)[j]];
	    }
	    score[i].wgroup = wg;
	    score[i].cnt = sc + wg;
	}
    }
    score.sort(function(x,y) { return y.cnt - x.cnt; });
    return score;
}

function matchQueryTable(queryString, do_stemming) {
    var oriQ = queryString;
    var m_idx = new Array();
    var st_idx = new Array();
    var lnk_score = new Array();
    var i,j,k;

    var q_results = new Array();	// save which query words hit

	// Separate the string into words.

    queryString = queryString.toLowerCase();

	// Remove punctuation except keep front slash

//    queryString = queryString.replace([\"\\\/\*\[\]><{}'.,;:!+()?=-], " ");
    queryString = queryString.replace(/["\\\*\[\]><{}'.,;:!+()?=-]/, " ");

	// Remove leading and trailing whitespace.

    queryString = queryString.replace(/^\s*/, "");
    queryString = queryString.replace(/\s*$/, "");
    queryString = queryString.split(/\s+/);

	// Implicitly 'OR' query words. Remove single letter queries, they
	// match [far] too often and mean nothing.

    for (i=queryString.length; --i > 0; ) {
	if (queryString[i].length < 2) {
	    queryString.splice(i,1);
    } }

        // Score non-stemmed words higher.

    if (do_stemming == "true") {
	for (i=queryString.length; --i >= 0; ) {
	    queryString[i] = stemmer(queryString[i]);
        }
	lnk_score = calculateScore(queryString, stemtext, lnk_score, m_idx, 1);
    } else {
	lnk_score = calculateScore(queryString, htmltext, lnk_score, m_idx, 1);
    }

    return lnk_score;
}	// matchQueryTable


// Build a block of HTML table data entries corresponding to the given
// category.  The matches are taken from the 'fileList' data table if they
// correspond to the given category.  The given title is used to describe the
// block of results in HTML.

function cellBlock(title, category, matches) {
    var tcell = '';
    var cat_cnt = 0, ent = 0, i;
    var hitcode = 0;

    for (i=0; i < matches.length; i++) {
	if (fileList[matches[i].idx][1] === category) cat_cnt++;
    }

    tcell += '<tr class="block"><td class="head"><td>';
    tcell += '<tr class="block"><td class="head">'+ title + "</td>";

    if (cat_cnt == 0) {
	tcell += '<tr class="ent"><td>No matches found.</td></tr>';
    }
//    tcell += '<td align="res">results found: '+ cat_cnt + "</td></tr>";

	// Future: write other entries in hidden block, which
	// is shown when press numbers.

    for (i=0; i < matches.length && ent < MAX_ENTRIES; i++) {
	if (fileList[matches[i].idx][1] !== category) continue;
	ent++;

	    // Write out query words.

	if (matches[i].wgroup != hitcode) {
	    var qw = matches[i].q;
	    tcell += '<tr class="ent">';
	    tcell += '<td style="padding: 0 0 0.5em 0.5em;"><br />'+
	        '<span style="font-size:1.25em;font-style:italic;color:#333333;">'+
		qw.join(",   ") + '</span></td>';
	    tcell += "<td><br />&nbsp;</td></tr>";
	    hitcode = matches[i].wgroup;	// next group of query words
	}
	tcell += '<tr class="ent">';
	tcell += '<td class="lnk">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;'+
	    fileList[matches[i].idx][0] + "</td>";
//	tcell += '<td class="cnt">['+ matches[i].cnt +']\n' + "</td></tr>";
    }

    tcell += '<tr class="ent"><td>&nbsp;<td><td>&nbsp;</td></tr>';
    return tcell;
}	// cellBlock()


// Generate an HTML table with results matching the given query string.  Scores
// are built by splitting the query string on whitespace and counting any
// matches from the datatables generated at the end of this file.  Scores are
// then augmented for files which contain each of the query words together.  A
// string of characters conforming to a well formatted HTML <table> is returned
// that contains the search results.

function genMatchTable(queryString, do_stemming) {
    var hits = [], stemhits = [], match_tbl = '';

	// Ignore leading and trailing space.

    queryString = unescape(queryString);
    queryString = queryString.replace(/^\s*/, "");
    queryString = queryString.replace(/\s*$/, "");

    if (queryString != '') {
	match_tbl += '<table class="srch_tbl"><tr class="block">';

	    // Find matches from the data tables.  Write matches by category.

	hits = matchQueryTable(queryString, do_stemming);

  	match_tbl += cellBlock('Manuals and Tutorials', 'MANUAL', hits);
  	match_tbl += cellBlock('Function Reference', 'FCNREF', hits);

	hits.length = 0;

	match_tbl += '\n</table>';
    }

    return match_tbl;
}	// genMatchTable()


